import React, { useContext } from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Dashboard from './admin/Dashboard';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Product from './components/Product';
import ProductItem from './components/ProductItem';
import ProductItemsPage from './pages/ProductItemsPage';
import ForgotPasswordFlow from './components/ForgotPasswordFlow';
import Cart from './pages/Cart';
import Checkout from './pages/Checkout';
import Confirmation from './pages/Confirmation';
import ProductPage from './admin/ProductPage';
import EditProduct from './admin/EditProduct';
import Customerview from './admin/Custormerview';
import Type from './admin/Type';
import AboutUs from './components/AboutUs';
import Contact from './components/Contact';
import AdminMessage from './admin/AdminMessage';
import AdminMessageDetail from './admin/AdminMessageDetail';
import Alert from "./components/Alert";

import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import AuthState from "./context/auth/AuthState"; 
import { CartProvider } from "./context/cart/CartState";
import AlertState from './context/alert/StateAlert';
import authContext from "./context/auth/authContext";

function AppContent() {
  // useContext here, AFTER AuthState
  const { user } = useContext(authContext);

  return (
    <Router>
      <Navbar />

      <Alert alert={null} /> {/* adjust your alert state */}

      <ProductItem />

      <Routes>
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/women" element={<Product category="women" />} />
        <Route path="/men" element={<Product category="Men" />} />
        <Route path="/product/:category/:type" element={<ProductItemsPage />} />
        <Route path="/forgot-password" element={<ForgotPasswordFlow />} />
        <Route path="/checkout" element={<Checkout />} />
        <Route path="/confirmation" element={<Confirmation />} />
        <Route path="/addproduct" element={<ProductPage />} />
        <Route path="/editproduct" element={<EditProduct />} />
        <Route path="/Customerview" element={<Customerview />} />
        <Route path="/type" element={<Type />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/about" element={<AboutUs />} />
        {/* Conditional default route */}
        <Route path="/" element={user?.admin ? <Dashboard /> : <Home />} />
      </Routes>

      {!user?.admin && <Footer />}
    </Router>
  );
}

function App() {
  return (
    <AuthState>
      <CartProvider>
        <AlertState>
          <AppContent /> {/* now user context is defined here */}
        </AlertState>
      </CartProvider>
    </AuthState>
  );
}

export default App;
